// Harmonia Logo - defined once, used everywhere
const HARMONIA_LOGO = 'data:image/png;base64,';

// Apply logo to all elements with data-harmonia-logo attribute
function initHarmoniaLogos() {
    document.querySelectorAll('[data-harmonia-logo]').forEach(img => {
        img.src = HARMONIA_LOGO;
    });
}

// Theme
function toggleTheme() {
    const html = document.documentElement;
    const newTheme = html.getAttribute('data-theme') === 'dark' ? 'light' : 'dark';
    html.setAttribute('data-theme', newTheme);
    localStorage.setItem('harmonia-theme', newTheme);
}
(function() {
    const saved = localStorage.getItem('harmonia-theme') || 'dark';
    document.documentElement.setAttribute('data-theme', saved);
})();

// Mobile Navigation Toggle
function toggleMobileNav() {
    const navLinks = document.querySelector('.nav-links');
    const hamburger = document.querySelector('.hamburger');
    navLinks.classList.toggle('mobile-open');
    hamburger.classList.toggle('active');
}

